"use strict";var showNav=function(t,e){t.classList.remove("hide"),t.classList.add("show"),e.setAttribute("aria-expanded","true")},hideNav=function(t,e){t.classList.remove("show"),t.classList.add("hide"),e.setAttribute("aria-expanded","false")},toggle=function(t,e){t.classList.contains("show")?hideNav(t,e):showNav(t,e)},mobileNav=function(){var e=document.getElementById("toggle"),i=document.getElementById("toggle-content");e.addEventListener("click",function(t){i&&toggle(i,e)}),window.addEventListener("resize",function(){window.innerWidth<992?i.classList.contains("show")&&toggle(i,e):i.classList.contains("hide")&&toggle(i,e)})};window.onload=function(){mobileNav()};